import { StyleSheet } from "react-native";

export default StyleSheet.create({

    top:{
        alignItems: 'center',
        margin: 5,
        borderColor: 'black',
        borderWidth: 1,
    },
    box:{
        flex: 1,
        alignItems: 'center',
        justifyContent: 'space-around',
        flexDirection: 'row',
        margin: 5,
        borderColor: 'black',
        borderWidth: 1,
    },
    txt:{
        fontWeight: 'bold',
    },
    indice:{
        margin: 5,
        alignItems: 'center',
        borderColor: 'black',
        borderWidth: 1,
        flexDirection: 'row',
        justifyContent: 'space-around', 
    },
})
